import React from 'react';
import Huge from '../components/Huge';
import Carousel from '../components/Carousel';
import Container from 'react-bootstrap/Container'; 
import Row from 'react-bootstrap/Row'; 
import Col from 'react-bootstrap/Col';
function EducationSection(props) {
	return(
		<div id = "education" className="homelayout  homecolour" >
			<Huge  subTitle={props.subTitle} />
			<Container fluid= {true}>
				<Row className = "justify ">
					<Col md = {2} sm={6}>
						<a href="http://www.buffalo.edu/" className="menus a" >
               <figure className="ml-3 mt-3">
              <img
                src={require("../images/ub.png")}
                style={{ width: 160, height: 140, borderRadius: 160/ 2 }}
				fluid
              />  
             
            </figure>  
            </a>
					</Col>
					<Col md = {10} sm={10}>
						 <h1 className = "edu p-lg-3 mt-0  intro  font-weight-LIGHT">University at Buffalo<small> - State University of New York</small></h1>
<h1 className = "edu p-lg-3 mt-0  intro  font-weight-LIGHT">Master os Science - Computer Science<small> - State University of New York</small></h1>

						 
						 <h3 className="lead font-weight-light">welcome</h3>
					</Col>
				</Row>
					<Row className = "justify p-5 mt-1">
					<Col md = {4} sm={6}>
						<a href="https://www.amrita.edu/" className="menus a" >
               <figure className="ml-3">
              <img
                src={require("../images/amrita.png")}
                style={{ width: 160, height: 160, borderRadius: 160/ 2 }}
				fluid
              />  
             
            </figure>  
            </a>
					</Col>
					<Col md = {4} sm={6}>
						 <h1 className = "display-1 font-weight-bolder">hii</h1>
						 <h3 className = "display-4 font-weight-light">hello</h3>
						 <h3 className="lead font-weight-light">welcome</h3>
					</Col>
				</Row>
			</Container>
			
		</div>
	);
}

export default EducationSection;
